graphy for over 30 years and have had our rights and freedoms challenged more times than we can remember. No one group or person has the ability to effect change across the board, however we are committed to doing our part by continuing to stand up for our constitutional right to free press and the right to take photographs and video in public. All donations will be used exclusively to further this cause. We want to thank you in advance for your support of what we do and want you to know that we are committed to working harder than ever to defend our rights, your rights and the Freedom to Film in Public!!\nLink to GoFundMe: "},{"text":"https://www.gofundme.com/help-keep-am...","navigationEndpoint":{"clickTrackingParams":"CJQBEM2rARgBIhMIrp7KxryR6gIV0jTgCh0O4gOsSIvGr93P65qkhgE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?redir_token=CygaNGM6vBZZ8RG1ysv6MHCEOdt8MTU5Mjc3OTYwNkAxNTkyNjkzMjA2\u0026v=hkhrXPur4ws\u0026q=https%3A%2F%2Fwww.gofundme.com%2Fhelp-keep-amagansett-press-on-the-road%26rcid%3Dr01-155101646049-01970d9110434a62%26pc%3Dot_co_campmgmt_w\u0026event=video_description","rootVe":83769}},"urlEndpoint":{"url":"/redirect?redir_token=CygaNGM6vBZZ8RG1ysv6MHCEOdt8MTU5Mjc3OTYwNkAxNTkyNjkzMjA2\u0026v=hkhrXPur4ws\u0026q=https%3A%2F%2Fwww.gofundme.com%2Fhelp-keep-amagansett-press-on-the-road%26rcid%3Dr01-155101646049-01970d9110434a62%26pc%3Dot_co_campmgmt_w\u0026event=video_description","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\nThis video if for educational purposes only. \nUnless otherwise specifically stated, all content, images and video are copyright 2009-2020 Amagansett Press (TM)"}]},"subscribeButton":{"buttonRenderer":{"style":"STYLE_DESTRUCTIVE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Subscribe"}]},"navigationEndpoint":{"clickTrackingParams":"CJUBEJsrIhMIrp7KxryR6gIV0jTgCh0O4gOs","commandMetadata":{"webCommandMetadata":{"ignoreNavigation":true}},"modalEndpoint":{"modal":{"modalWithTitleAndButtonRende ext":"Uzbek"}},{"languageCode":"vi","languageName":{"simpleText":"Vietnamese"}},{"languageCode":"cy","languageName":{"simpleText":"Welsh"}},{"languageCode":"fy","languageName":{"simpleText":"Western Frisian"}},{"languageCode":"xh","languageName":{"simpleText":"Xhosa"}},{"languageCode":"yi","languageName":{"simpleText":"Yiddish"}},{"languageCode":"yo","languageName":{"simpleText":"Yoruba"}},{"languageCode":"zu","languageName":{"simpleText":"Zulu"}}],"defaultAudioTrackIndex":0}},"videoDetails":{"videoId":"hkhrXPur4ws","title":"TYRANT COPS MAKE A BIG MISTAKE - Silverthorne Colorado - First Amendment Audit - Amagansett Press","lengthSeconds":"3110","keywords":["first amendment audit","1st amendment audit","amagansett press","high desert community watch","news now houston","news now california","auditing america","anselmo morales","sgv news first","san joaquin valley transparency","news now patrick","james freeman","johnny 5-0","cop watch","furry potato","kern county transparency","rights crispy","tulare county cop watch","the battousai","news now dallas","honor your oath","sgv news","rogue nation","public photography"],"channelId":"UCIYocUCja9Ug_XiYROeb_cw","isOwnerViewing":false,"shortDescription":"TYRANT COPS MAKE A BIG MISTAKE - Silverthorne Colorado - First Amendment Audit - Amagansett Press with Watching The Watchmen\n\nLink to Watching The Watchmen : https://www.youtube.com/channel/UCq94tZvLY5-orEFs1YjKRSw\n\nThank you shout-out to our supporters !!\n(click here for membership info: https://www.youtube.com/channel/UCIYocUCja9Ug_XiYROeb_cw/join )\n\nSILVER TIER MEMBERS:\nAble60\nDC Streight\nDANNY TOWNSEND\nMatt Williams\nKirk Loftis\n\nBRONZE TIER MEMBERS:\nJump Keys\nSan Diego Jon\nWhistle Man\nThe Way I Feel\n\n\n\nU.S. Constitution NOT void where prohibited by law !!\n\nHELP KEEP AMAGANSETT PRESS ON THE ROAD:\nhttps://www.gofundme.com/help-keep-amagansett-press-on-the-road\u0026rcid=r01-155101646049-01970d9110434a62\u0026pc=ot_co_campmgmt_w\n\nWe believe that many of our rights and civil liberties as American citizens on American soil are at great risk and that a simple act of civil disobedience has the power to effect great change. While we have no interest or intention in breaking any law, we are willing to stand up for freedom and the constitution at any time and at any place and do so in a responsible and productive manner. It is our goal to create free and open discussion whenever possible in an effort to educate both ourselves and anyone with a desire to learn. A well known rule of government is that ignorance is no excuse for the law. It is our stand that we as Americans have been either uninformed or misinformed regarding our laws and rights for far too long. We are not attorneys or scholars, however we have been involved in professional photography for over 30 years and have had our rights and freedoms challenged more times than we can remember. No one group or person has the ability to effect change across the board, however we are committed to doing our part by continuing to stand up for our constitutional right to free press and the right to take photographs and video in public. All donations will be used exclusively to further this cause. We want to thank you in advance for your support of what we do and want you to know that we are committed to working harder than ever to defend our rights, your rights and the Freedom to Film in Public!!\nLink to GoFundMe: https://www.gofundme.com/help-keep-amagansett-press-on-the-road\u0026rcid=r01-155101646049-01970d9110434a62\u0026pc=ot_co_campmgmt_w\n\nThis video if for educational purposes only. \nUnless otherwise specifically stated, all content, images and video are copyright 2009-2020 Amagansett Press (TM)","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/hkhrXPur4ws/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLBhdPkJHbd00vJ_FYJ-69N6nH_iTg","width":168,"height":94},{"url":"https://i.ytimg.com/vi/
